dependencies_changed=()
if [ -z "${ghprbTargetBranch}" ]
then
  if which hub &>/dev/null
  then
    ghprbTargetBranch=`hub pr show --format=%B` || true
  fi
fi

if [ -z "${ghprbTargetBranch}" ]
then
  ghprbTargetBranch=`git rev-parse --abbrev-ref HEAD | sed -e "s/^\([^@]*\)$/\1@master/" | sed -e "s/^.*@//"`
fi

BASE_SHA=`git merge-base origin/${ghprbTargetBranch} HEAD`

diff=`git diff --name-only ${BASE_SHA}..HEAD | sed 's:.*/::'`

for class in ${diff[@]}
do
  if [[ $class == *.java ]]; then
    without_extension=`echo "$class" | sed  's/\.[^.]*$//'`
    if [[ $dependencies == *."$without_extension"* ]]; then
        dependencies_changed+=("$class")
    fi
  elif  [[ $class == *.proto ]]; then
  	dependencies_changed+=("$class")
  fi
done

if [[ ! -z "$dependencies_changed" ]]; then
   echo -e "Delegate task communication dependent classes that were changed in your branch: "
   for changed_class in ${dependencies_changed[@]};do
   	echo "- "$changed_class
   done
fi
